import { useAuth0 } from "@auth0/auth0-react";
import React from "react";
import NavBar from "../components/nav-bar";
const Profile = () => {
  const { user, isAuthenticated, isLoading } = useAuth0();
    
  if (isLoading) {
    return <div>Loading ...</div>;
  }

  return (
    isAuthenticated && (
      <div style={{backgroundImage: `url("https://www.mapcommunications.com/wp-content/uploads/2018/09/MAP-Communications-Answering-Service.jpg")` ,backgroundRepeat:"no-repeat",backgroundPosition:"center" } }>
        <NavBar />
        <img src={user.picture} alt={user.name} />
        <h2>{user.name}</h2>
        <p>{user.email}</p>
      </div>
    )
  );
};

export default Profile;
